import Auth from './Auth/Auth';
import Employees from './Employees/Employees';
import Employees_Roles from './Employees_Roles/Employees_Roles';
import Projects from './Projects/Projects';
import Languages from './Languages/Languages';
import Productivity from './Productivity/Productivity';
import Reports from './Reports/Reports';
import SLA from './SLA/SLA';
import SLATypes from './SLA/SLA_Types';
import Targets from './Targets/Targets';
import Test from './Test/Test';
import Users from './Users/Users';

export default class ROUTES {
   constructor() {
      return this;
   }

   static AUTH = Auth;

   static EMPLOYEES = Employees;

   static EMPLOYEES_ROLES = Employees_Roles;

   static PROJECTS = Projects;

   static LANGUAGES = Languages;

   static PRODUCTIVITY = Productivity;

   static REPORTS = Reports;

   static SLA = SLA;

   static SLA_TYPES = SLATypes;

   static TARGETS = Targets;

   static TEST = Test;

   static USERS = Users;
}
